import React, { Component } from 'react'
import axios from 'axios';

class DeleteAppointment extends Component {
    state = {
        content: ''
    }
    handleChange = (e) => {
        this.setState({
            content: e.target.value
        });
    }
    handleSubmit = (e) => {
        e.preventDefault();
        // call function to add a todo
        const appointment = { 
            Name: document.getElementById("SubmitTitle").value,
            Start: document.getElementById("SubmitStart").value,
            End: document.getElementById("SubmitEnd").value 
        };
        const url = 'https://noname.lab.medsolv.net/shifts';
        axios.post(url, appointment);

    }
    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <label>Einen Termin löschen:</label>
                    <input id="SubmitTitle" type="text" onChange={this.handleChange} value={this.state.Title} placeholder="Id der Schicht" />
                    <button type="submit">Submit</button>
                </form>
            </div>
        )
    }
}

export default DeleteAppointment
